import React from "react";
import { Link } from "react-router-dom";
import Section from "../components/UI/Section";
import SectionDivider from "../components/UI/SectionDivider";
import { motion } from "framer-motion";
import DueDateCountdown from "../components/DueDateCountdown";

const Home = () => {
  return (
    <div className="min-h-screen bg-transparent font-sans text-cozyGray">
      {/* Hero Section */}
      <Section center tightTop compact>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, ease: "easeOut" }}
          className="relative overflow-hidden rounded-bubble bg-gradient-to-br from-blush/80 via-cloudWhite/90 to-softSky/80 px-6 py-16 text-center shadow-dreamy border border-softLavender/40"
        >
          <motion.h1
            initial={{ opacity: 0, y: 24, scale: 0.98 }}
            animate={{ opacity: 1, y: 0, scale: [0.98, 1.03, 1] }}
            transition={{ duration: 0.55, ease: "easeOut" }}
            className="mb-4 text-center font-cursive leading-tight text-cozyGray text-4xl sm:text-5xl tracking-tight"
          >
            <motion.span className="font-cursive text-6xl sm:text-[4rem] inline-block mr-2 text-babyPink">
              Taylor-Made
            </motion.span>
            <motion.span className="font-cursive text-softLavender">
              Baby Planning
            </motion.span>
          </motion.h1>

          <p className="font-sans text-lg md:text-xl text-cozyGray/80 max-w-2xl mx-auto">
            A calm, confident path to welcoming your little one. Personalized
            registries, nursery design, shower planning, and ongoing
            support‚Äîtailored to your family.
          </p>

          <motion.img
            src="/assets/hero-baby.png"
            alt="Baby Planning Illustration"
            className="mx-auto mt-6 max-w-md drop-shadow-lg animate-float"
            initial={{ opacity: 0, scale: 0.95 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.8, ease: "easeOut", delay: 0.3 }}
          />

          <div className="mt-8 flex flex-wrap justify-center gap-4">
            <Link
              to="/services"
              className="btn-primary text-base md:text-lg px-8 py-3"
            >
              Explore Services
            </Link>
            <Link
              to="/contact"
              className="btn-secondary text-base md:text-lg px-8 py-3"
            >
              Book a Consultation
            </Link>
          </div>

          <div className="mt-10 grid gap-6 text-left text-black/80 md:grid-cols-3">
            {[
              { icon: "üçº", label: "Invite-Only", detail: "A discreet client list curated by referral." },
              { icon: "üß∏", label: "Concierge Care", detail: "Taylor personally oversees every decision." },
              { icon: "üë∂", label: "Confidential Always", detail: "NDA-backed planning and event management." },
            ].map(({ icon, label, detail }, index) => (
              <motion.div
                key={label}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: 0.2 + index * 0.15 }}
                className="rounded-2xl border border-babyBlue/30 bg-babyPink/20 px-5 py-4 shadow-sm hover:bg-babyBlue/20 transition"
              >
                <div className="text-3xl">{icon}</div>
                <p className="mt-3 font-cursive text-lg text-black">{label}</p>
                <p className="text-sm font-sans text-black/70">{detail}</p>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </Section>

      {/* Countdown Section */}
      <Section title="Countdown to Baby Day üéâ" center className="bg-babyBlue/20 rounded-3xl">
        <DueDateCountdown dueDate="2025-12-01" />
      </Section>

      <SectionDivider className="my-6" />

      {/* Services Section */}
      <Section title="Services Snapshot" tightTop compact className="bg-pastelGreen/20 rounded-3xl">
        <div className="px-6 py-6">
          <div className="grid gap-6 md:grid-cols-2 lg:grid-cols-3">
            {[
